Bijgesloten is de uitnodiging voor de uitreiking door de minister van Defensie op woensdag 12 oktober 2016, van 09:30.-13:00 uur, van de herinneringsmedaille Vredesoperaties aan militairen van de Koninklijke Landmacht en de Koninklijke Marine die &eacute;&eacute;n of meerdere speciale operaties hebben uitgevoerd. Deze medaille-uitreiking zal plaatsvinden in de Van Ghent-kazerne, Toepad 120, 3063NJ, Rotterdam. Zoals gebruikelijk zullen aanwezige Kamerleden een rol vervullen bij het decoreren van de militairen.<br />
